import 'bootstrap/dist/css/bootstrap.min.css';
import logoGeo from '../assets/img/logo/geo-logo.svg'
function HeaderFDI() {
  return (
    <div>
    <div className="row mt-2 height: 100px">
    <div class="row">
    <div class="col">
      1 of 3
    </div>
    <div class="col-6">
      2 of 3 (wider)
    </div>
    <div class="col">
      3 of 3
    </div>
  </div>
    </div>
    </div>
  );
}
export default HeaderFDI;
